const outerStyles = `
    &__links {
        position: sticky;
        bottom: 0;
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        padding-top: 30px;
        border-top: 1px solid silver;
        background-color: white;
    }

    &__link-item {
        display: flex;
        align-items: center;
    }

    &__link-item + &__link-item {
        margin-top: 12px;
    }

    &__link {
        display: flex;
        height: 40px;
        width: 150px;
        margin-right: 20px;
    }

    &__link-image {
        width: 100%;
        height: 100%;
        object-fit: cover;
    }

    &__price {
        font-weight: bold;
    }

    &__diff {
        margin-left: 20px;
        font-weight: bold;
    }

    &__diff--lower {
        margin-left: 20px;
        font-weight: bold;
        color: green;
    }

    &__diff--higher {
        margin-left: 20px;
        font-weight: bold;
        color: red;
    }
`.replace(/[&]/g, rootSelector);



